import React, { Component } from 'react';
import Modal from '@material-ui/core/Modal';
import Typography from '@material-ui/core/Typography';
import CustomListItem from './ListItem'

const textStyle = {
    position: 'absolute',
    left: 1450
}
const body = <CustomListItem leng={12} />
const body2 = <CustomListItem leng={5} />
class UserPresent extends Component {
    state = {
        open: false,
        location: false,
        visitor: false
    }
    handleOpenVisitor = () => {
        this.setState({
            open: !this.state.open,
            visitor: !this.state.visitor
        })
    }
    handleCloseVisitor = () => {
        this.setState({
            open: !this.state.open,
            visitor: !this.state.visitor
        })
    }
  render() {
    return (
        <div style={textStyle}>
        <Typography variant="h5" onClick={this.handleOpen}>
            Total Visitors : 12
         </Typography>
         <Modal
            open={this.state.open}
            onClose={this.handleCloseVisitor}
            aria-labelledby="simple-modal-title"
            aria-describedby="simple-modal-description"
        >
            {this.state.visitor ? body : body2}
        </Modal>
        
        <Typography variant="h5" >
            At this Location : 5
</Typography>


    </div>
    );
  }
}

export default UserPresent;
